void ScreenTableViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &button1)
    {
        //Interaction1
        //When button1 clicked change screen to Screen2
        //Go to Screen2 with screen transition towards South
        application().gotoScreen2ScreenSlideTransitionSouth();
    }
    else if (&src == &toggleButton1)
    {
        //chooseTemp1
        //When toggleButton1 clicked show textTemp1
        //Show textTemp1
        textTemp1.setVisible(true);
        textTemp1.invalidate();

        //chooseTemp
        //When toggleButton1 clicked call virtual function
        //Call virtChooseTemp
        virtChooseTemp();
    }
}
